L’essence est un liquide inflammable, issu de la distillation du pétrole, utilisé comme carburant dans les moteurs à combustion interne. C'est un mélange d’hydrocarbures, auxquels peuvent être ajoutés des additifs pour carburants. De nombreux types d'essence (dont essences spéciales) sont fabriqués et mis sur le marché. On y trouve en moyenne : 
*  20 % à 30 % d’alcanes, hydrocarbures saturés de formule CnH2n+2 ; 
*  5 % de cycloalcanes, hydrocarbures saturés cycliques ; 
*  30 % à 45 % d’alcènes, hydrocarbures insaturés ; 
*  30 % à 45 % d’hydrocarbures aromatiques, de la famille du benzène ; 
*  et divers additifs techniques.
